import React from 'react';
import Link from 'next/link';

const NavBar = () => {
  return (
    <div className="bg-gray-500 py-3">
      <Link href="/Sobre">
          <a>sobre</a> 
        </Link>
      <Link href="/Cadastro">
        <a>cadastro</a> 
      </Link>

      <Link href="/Esntrar">
        <a>entrar</a> 
      </Link>

    </div>
  )
}
export default NavBar;
